  (6098, '50 Positive Daily Affirmation Flash Cards - Great for business', '50 Positive Daily Affirmation Flash Cards - Great for business in Books, Magazines, Non-Fiction Books', '9.90', 1, 'New', 'ForSale'),
  (6099, 'The Power of Now: A Guide to Spiritual Enlightenment by Eckhart Tolle NEW Aus St', 'Much more than simple principles and platitudes, The Power of Now takes readers on an inspiring spiritual journey to find their true and deepest self and reach the ultimate in personal growth and spirituality: the discovery of truth and light.', '14.25', 6, 'New', 'Wanted'),
  (6100, 'NEW The Subtle Art of Not Giving a F*ck - Signed Copies Available!* By Mark Mans', 'NEW The Subtle Art of Not Giving a F ck - Signed Copies Available! By Mark Mans. The Subtle Art of Not Giving a F ck - Signed Copies Available! An antidote to the coddling, let''s-all-feel-good mindset that has infected modern society, and filled with entertaining stories and profane, ruthless humour,The Subtle Art of Not Giving a F k is a refreshing slap in the face for a generation spoiled by being rewarded with gold medals just for showing up.', '25.50', 0, 'New', 'ForSale'),
  (6101, 'NEW Good Night Stories for Rebel Girls By Elena Favilli Hardcover Free Shipping', 'Good Night Stories for Rebel Girls. Good Night Stories for Rebel Girls introduces us to one hundred remarkable women and their extraordinary lives. From Marie Curie to Malala, Ada Lovelace to Zaha Hadid, this book brings together the stories of scientists, artists, politicians, pirates and spies.', '27.50', 4, 'New', 'Wanted'),
  (6102, 'The Subtle Art of Not Giving a F*ck: A Counterintuitive Approach to Living a Goo', 'For decades, we''ve been told that positive thinking is the key to a happy, rich life. Drawing on academic research and the life experience that comes from breaking the rules, Mark Manson is ready to explode that myth.', '29.47', 9, 'New', 'ForSale'),
  (6103, 'NEW Rich Dad Poor Dad By Robert T. Kiyosaki Paperback Free Shipping', 'Rich Dad Poor Dad is Robert''s story of growing up with two dads  his real father and the father of his best friend, his rich dad  and the ways in which both men shaped his thoughts about money and investing.', '12.50', 3, 'New', 'Wanted'),
  (6104, 'NEW The Art of War By Sun Tzu Paperback Free Shipping', 'Sun Tzu is a honorific title bestowed upon Sūn Wu (c. 544-496 BC), the author of The Art of War, an immensely influential ancient Chinese book on military strategy. He is also one of the earliest realists in international relations theory.', '8.50', 5, 'New', 'ForSale'),
  (6105, 'The Power of Now by Eckhart Tolle Book | Brand New & Free Shipping', 'Eckhart Tolle demonstrates how to live a healthier and happier life by living in the present moment. To make the journey into The Power of Now we will need to leave our analytical mind and its false created self, the ego, behind.', '13.05', 4, 'New', 'Wanted'),
  (6106, 'NEW The Australian Bird Guide By Peter Menkhorst Paperback Free Shipping', 'Australia''s avifauna is large, diverse and spectacular, reflecting the continent''s impressive range of habitats and evolutionary history. With specially commissioned paintings of over 900 species,The Australian Bird Guide is the most comprehensive field guide to Australian birds ever seen.', '40.50', 1, 'New', 'ForSale'),
